package tr.edu.medipol.yazilim.meryem.carpma;

public class Carpma {
	static int carp(int sayi1, int sayi2) {
		return sayi1 * sayi2;
	}
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int sonuc = carp(10,21);
		
		System.out.println("10 * 210 = " + sonuc);


	}

}
